import React from 'react'
import axios from 'axios'

const genPost = async() => {
	const data = await axios.get('http://localhost:5000/api')
	console.log(data.data.Data)
	return data.data.Data
}

const App = () => {
	const theData = genPost()
  return (
		<div className="ui container comments">
			{theData.AreaId}
		</div>
  )
}

export default App
